import { Hero } from './hero';

export const HEROES: Hero[] = [

  { id: 1, name: 'Nice' },
  { id: 2, name: 'Boulogne' },
  { id: 3, name: 'Cerny' },
  { id: 4, name: 'Montpellier' },
  { id: 5, name: 'Strasbourg' },
  { id: 6, name: 'Metz' },
  { id: 7, name: 'Lille' },
  { id: 8, name: 'Lyon' },
  { id: 9, name: 'Villeneuve' }

];
